import clsx from 'clsx'
import {useState,useEffect} from 'react'
import axios from 'axios'

import styles from '../User.module.scss'
import Header from '../../Header/Header'
import Toast from '../../Toast'

export default function BookedTours(){
    useEffect(() => {
        axios.get('http://localhost:8000/api/user/current-user/get-tour-booked',{
            headers: {authorization: localStorage.getItem('token')}
        })
        .then(res => {
            console.log(res);
        })
        .catch(err => {
            console.log(err);
        })
    },[])
    return (
    <>
        <Header />
        <div className="grid wide">
            <ul className="listTour">
                <ul className="row">
                    <li className="">STT</li>
                    <li className="">Ngày thanh toán</li>
                    <li className="">Thanh toán</li>
                    <li className="">Tổng tiền</li>
                    <li className="">Số người</li>
                    <li className="">Chi tiết tour</li>
                </ul>
            </ul>
        </div>
    </>
    )
}
